function keyWasPressed(keyPressed)
{
    if(gameActive)
    {
        if(keyPressed.charCodeAt() >= 97 && keyPressed.charCodeAt() <= 122)
        {
            if(currentLetter < amountOfLetters)
            {
                letterBoxes[currentRow * amountOfLetters + currentLetter].innerText = keyPressed.toUpperCase();
                currentLetter++;
            }
        }
        else if(keyPressed == "Backspace")
        {
            if(currentLetter > 0)
            {
                currentLetter--;
                letterBoxes[currentRow * amountOfLetters + currentLetter].innerText = "";
            }
        }

        else if(keyPressed == "Enter")
        {
            guess();
        }
    } 
}

function guess()
{
    currentGuess = ""
    if(currentLetter == amountOfLetters)
    {
        for(i=0;i<amountOfLetters;i++)
        {
            currentGuess += letterBoxes[currentRow * amountOfLetters + i].innerHTML;
        }
        currentGuess = currentGuess.toLowerCase();
        if(wordExists())
        {
            CompareCurrentGuess();
        }
        else
        {
            //showMessage("not in wordlist", 1000, true, 1);
            showMessage("<p><span id='yellow'>" + currentGuess + "</span> not in wordlist</p>", 1000, true, 1);
        }
    }
    else
    {
        showMessage("word not long enough", 1000, true, 1);
    }
}

function wordExists()
{
    firstLetterCode = currentGuess[0].charCodeAt() - 97;
    RowToCheck = wordListToCheck[firstLetterCode];
    for(i=0;i<RowToCheck.length;i++)
    {
        if(currentGuess == RowToCheck[i])
        {
            return true;
        }
    }
    return false;
}

